import reactDom from "react-dom";
let curDate=new Date(21,5,5,8);
curDate=curDate.getHours();
let greet ='';
const cssStyle={}; 
if(curDate>=1 && curDate<12){
greet="good mornig";
cssStyle.color="geen";

}

else if(curDate>=12 && curDate<19){
    greet="good after noon";

    cssStyle.color="blue";
}
else{
    greet="good noght";
    cssStyle.color="dark blue";
}

